import React from 'react';
import Tables from './tables';


class AssignedSurveys extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            assignedSurveys: this.props.assSurveys
        }
    }

    componentDidUpdate(prevProps){
        console.log("changed")
        console.log(prevProps)
        console.log(pr)
        if(this.props.assignedSurveys !== prevProps.assignedSurveys){
         this.setState({
          assignedSurveys:this.props.assignedSurveys,
         })
        }}

    render(){

        const {assignedSurveys} = this.state;
        return(
                <div className="column is-centered has-text-centered">
                    Assigned Surveys
                    <div className="table-container">
                            <table className="table is-bordered is-striped is-narrow is-hoverable is-fullwidth">
                                <tbody>
                                    {assignedSurveys.map( (survey) => {
                                                return <Tables survey={survey.name} key={survey.sid}/>
                                        })
                                    }
                            </tbody>
                            </table>
                        </div>
                </div>

        )
    }
}

export default AssignedSurveys
